'''Mrs. Parish''' is a character in ''[[Leaf by Niggle]]''. She is the neighbour of [[Niggle]], and the wife of [[Mr. Parish]]. She has a cold that she unknowingly spreads to Niggle when he is enlisted by Mr. Parish to got out into the rain to get the [[Doctor]], who arrives two days late, in time to deal with both Mrs. Parish and Niggle.

